import React, { useState, useEffect } from 'react';
import {
  Box,
  Card,
  CardContent,
  Typography,
  Button,
  Grid,
  Alert,
  Chip,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
} from '@mui/material';
import { ShoppingCart, Sell } from '@mui/icons-material';
import { marketplaceAPI, handleAPIError } from '../services/api';
import { useSnackbar } from 'notistack';

const Marketplace = () => {
  const { enqueueSnackbar } = useSnackbar();
  const [listings, setListings] = useState([]);
  const [purchaseDialog, setPurchaseDialog] = useState(false);
  const [selectedListing, setSelectedListing] = useState(null);
  const [quantity, setQuantity] = useState('');

  useEffect(() => {
    loadListings();
  }, []);

  const loadListings = async () => {
    try {
      const result = await marketplaceAPI.getListings();
      setListings(result.listings || []);
    } catch (error) {
      const errorInfo = handleAPIError(error);
      enqueueSnackbar(errorInfo.message, { variant: 'error' });
    }
  };

  const handlePurchase = async () => {
    try {
      await marketplaceAPI.purchaseCredits(selectedListing.listing_id, parseFloat(quantity));
      enqueueSnackbar('Carbon credits purchased successfully!', { variant: 'success' });
      setPurchaseDialog(false);
      setQuantity('');
      loadListings();
    } catch (error) {
      const errorInfo = handleAPIError(error);
      enqueueSnackbar(errorInfo.message, { variant: 'error' });
    }
  };

  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        Carbon Credit Marketplace
      </Typography>

      <Alert severity="success" sx={{ mb: 3 }}>
        Trade verified blue carbon credits from restoration projects
      </Alert>

      <Grid container spacing={3}>
        {listings.length === 0 ? (
          <Grid item xs={12}>
            <Card>
              <CardContent sx={{ textAlign: 'center', py: 6 }}>
                <Typography variant="h6" color="textSecondary" gutterBottom>
                  No carbon credits available
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  Check back later for verified carbon credits from blue carbon projects
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        ) : (
          listings.map((listing) => (
            <Grid item xs={12} md={6} lg={4} key={listing.listing_id}>
              <Card>
                <CardContent>
                  <Box display="flex" justifyContent="space-between" alignItems="flex-start" mb={2}>
                    <Typography variant="h6">
                      {listing.credit_amount} Credits
                    </Typography>
                    <Chip
                      label={listing.status}
                      color="primary"
                      size="small"
                    />
                  </Box>

                  <Typography variant="h4" color="primary" gutterBottom>
                    {listing.price_per_credit} MATIC
                  </Typography>
                  <Typography variant="caption" color="textSecondary" display="block">
                    per credit
                  </Typography>

                  <Typography variant="body2" sx={{ mt: 2, mb: 2 }}>
                    <strong>Project:</strong> {listing.project_id}
                  </Typography>

                  <Typography variant="body2" sx={{ mb: 2 }}>
                    <strong>Total Value:</strong> {listing.total_value} MATIC
                  </Typography>

                  <Typography variant="body2" sx={{ mb: 2 }}>
                    <strong>Certification:</strong> {listing.certification_level || 'Verified'}
                  </Typography>

                  <Typography variant="body2" sx={{ mb: 3 }}>
                    {listing.description}
                  </Typography>

                  <Button
                    fullWidth
                    variant="contained"
                    startIcon={<ShoppingCart />}
                    onClick={() => {
                      setSelectedListing(listing);
                      setPurchaseDialog(true);
                    }}
                  >
                    Purchase Credits
                  </Button>
                </CardContent>
              </Card>
            </Grid>
          ))
        )}
      </Grid>

      {/* Purchase Dialog */}
      <Dialog open={purchaseDialog} onClose={() => setPurchaseDialog(false)} maxWidth="sm" fullWidth>
        <DialogTitle>Purchase Carbon Credits</DialogTitle>
        <DialogContent>
          {selectedListing && (
            <Box>
              <Typography gutterBottom>
                <strong>Available Credits:</strong> {selectedListing.credit_amount}
              </Typography>
              <Typography gutterBottom>
                <strong>Price per Credit:</strong> {selectedListing.price_per_credit} MATIC
              </Typography>

              <TextField
                fullWidth
                type="number"
                label="Quantity to Purchase"
                value={quantity}
                onChange={(e) => setQuantity(e.target.value)}
                sx={{ mt: 2, mb: 2 }}
                inputProps={{ 
                  min: 0.1, 
                  max: selectedListing.credit_amount,
                  step: 0.1 
                }}
              />

              {quantity && (
                <Typography variant="h6" color="primary">
                  Total: {(parseFloat(quantity) * selectedListing.price_per_credit).toFixed(2)} MATIC
                </Typography>
              )}
            </Box>
          )}
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setPurchaseDialog(false)}>Cancel</Button>
          <Button
            variant="contained"
            onClick={handlePurchase}
            disabled={!quantity || parseFloat(quantity) <= 0}
          >
            Purchase
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default Marketplace;
